/**
 * 路由组件
 * components 有许多指向是一样的，是页面中存在共用部分
 * 这样做之后显得部分代码冗余，后续找到更好的方式再做替换
 */
import ChatContainer from '../containers/chat'
import Setting from '../containers/setting'
import MailList from '../containers/mail-list'
import Welcome from '../components/welcome'
import ChatMessage from '../containers/chat/message'

const Routers = [
    {
        path: '/',
        components: ChatContainer
    },
    {
        path: '/welcome',
        components: Welcome
    },
    {
        path: '/message',
        components: ChatMessage
    },
    {
        path: '/mail-list',
        components: MailList
    },
    {
        path: '/setting',
        components: Setting
    },
    {
        path: '/set-message',
        components: Setting
    },
    {
        path: '/set-page',
        components: Setting
    },
    {
        path: '/set-login',
        components: Setting
    },
    {
        path: '/set-about',
        components: Setting
    },
    {
        path: '/login',
        components: ''
    }
]

export default Routers
